import { IconDashboard } from "components/icon";
import React from "react";
import { NavLink } from "react-router-dom";
const sidebarLinks = [
  {
    icon: <IconDashboard></IconDashboard>,
    title: "Dashboard",
    url: "/",
  },
];
const DashboardSidebar = () => {
  return (
    <div className="w-full md:w-[76px] rounded-3xl bg-white shadow-[10x_10px_20px_rgba(218,_213,_213,_0.15)]">
      {sidebarLinks.map((link) => (
        <NavLink to={link.url} key={link.title} className="flex items-center ">
          {link.icon}
          {link.title}
        </NavLink>
      ))}
    </div>
  );
};

export default DashboardSidebar;
